        }
    }


    hendal(){
        this.setState({
            name:"rafik bhai"
        })
    }

    render() { 
        return ( 
            <div>
                <h1>{this.state.name}</h1>
                <button onClick={this.hendal()}>click me!!!!</button>
            </div>
         );
    }
}

export default Second;
